import {Injectable} from '@angular/core';
import {PcInformation} from './pcinformation';
@Injectable({
  providedIn: 'root',
})
export class PcService {
  url = 'http://localhost:3000/computers';

  async getAllPcInformation(): Promise<PcInformation[]> {
    const data = await fetch(this.url);
    return (await data.json()) ?? [];
  }

  async getPcInformationById(id: number): PcInformation | undefined {
    const data = await fetch(`${this.url}/${id}`);
    return (await data.json()) ?? {};
  }

  submitApplication(firstName: string, lastName: string, email: string) {
    console.log(
      `Pc Stock Enquiry Received: firstName: ${firstName}, lastName: ${lastName}, email: ${email}.`,
    );
  }
}
